import React, { useState } from 'react';
import FoodItem from '../components/FoodItem';

function Order(props) {


    const item = props.examples.map(example => {
        return (
            <div key={example.id} className="col-md-5 m-1" >

                <FoodItem example={example} shopping={props.shoppingCart} />
            </div>
        );
    });

    return (
        <div className="container">
            <div className="row">
                {item}
            </div>
        </div>
    )
}

export default Order;
